import cx from "classnames";
import PropTypes from "prop-types";

const TitleSection = () => {
  return (
    <>
      <container className="flex">
        <div>
          <img
            src="../src/assets/New Headshot Square JUST HEAD - Mateo Hernandez copy.png"
            alt="''"
            width="100px"
            height="100px"
          ></img>
        </div>
        <div className="text-[10rem] flex-1">
          <h1>Mateo</h1>
        </div>
      </container>
    </>
  );
};

export default TitleSection;
